        single by Taylor Swift","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Shake_It_Off","revisions":"https://en.wikipedia.org/wiki/Shake_It_Off?action=history","edit":"https://en.wikipedia.org/wiki/Shake_It_Off?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Shake_It_Off"},"mobile":{"page":"https://en.wikipedia.org/wiki/Shake_It_Off","revisions":"https://en.wikipedia.org/wiki/Special:History/Shake_It_Off","edit":"https://en.wikipedia.org/wiki/Shake_It_Off?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Shake_It_Off"}},"extract":"\"Shake
        It Off\" is a song by the American singer-songwriter Taylor Swift and the
        lead single from her fifth studio album, 1989 (2014). She wrote the song with
        its producers, Max Martin and Shellback. Inspired by the media scrutiny on
        Swift''s public image, the lyrics are about her indifference to detractors
        and their negative remarks. An uptempo dance-pop song, \"Shake It Off\" features
        a looping drum beat, a Mellotron-based saxophone line, and a handclap-accented
        bridge. Big Machine Records released it on August 18, 2014, to promote 1989
        as Swift''s first pop album after her previous country image and sound.","extract_html":"<p>\"<b>Shake
        It Off</b>\" is a song by the American singer-songwriter Taylor Swift and
        the lead single from her fifth studio album, <i>1989</i> (2014). She wrote
        the song with its producers, Max Martin and Shellback. Inspired by the media
        scrutiny on Swift''s public image, the lyrics are about her indifference to
        detractors and their negative remarks. An uptempo dance-pop song, \"Shake
        It Off\" features a looping drum beat, a Mellotron-based saxophone line, and
        a handclap-accented bridge. Big Machine Records released it on August 18,
        2014, to promote <i>1989</i> as Swift''s first pop album after her previous
        country image and sound.</p>"}'
